import React from 'react';

export default class WeatherReport extends React.Component {
  render(props) {
    const title = this.props.city ? null : <h1>Weather Forecast</h1>;
    return (
      <div>
        <div>
          {title}
          <img src={this.props.data 
            ? require(`.../public/images/${this.props.data.icon}.svg`)
            : require('../public/images/01d.svg')} />
        </div>
      </div>
    )
  }
}
